import { Mail, Notifications, Pets } from "@mui/icons-material";
import { AppBar, Avatar, Badge, Box, InputBase, Menu, MenuItem, styled, Toolbar, Typography } from "@mui/material";
import React from "react";

const StyledToolbar = styled(Toolbar)({
    display:"flex",
    justifyContent:"space-between"
});

const Search = styled("div")(({ theme }) => ({
    backgroundColor: "white",
    padding:"0 10px",
    borderRadius: theme.shape.borderRadius,
    width:"40%"
})); 
const Icons = styled(Box)(({ theme }) => ({
    display:"none",
    alignItems:"center",
    gap:"20px",
    [theme.breakpoints.up("sm")]:{
        display:"flex"
    }
})); 
const UserBox = styled(Box)(({ theme }) => ({
    display:"flex",
    alignItems:"center",
    gap:"10px",
    [theme.breakpoints.up("sm")]:{
        display:"none"
    }
})); 



const Navbar = () => {
        return (
            <AppBar position="stick">
                <StyledToolbar>
                    <Typography variant="h6" sx={{display:{xs:"none", sm:"block"}}}>G WEALTH</Typography>
                    <Pets sx={{ display: { xs: "block", sm: "none" } }} />
                    <Search><InputBase placeholder="search..."/></Search>
                    <Icons>
                        <Badge badgeContent={4} color="error">
                        <Mail />
                        </Badge>
                        <Badge badgeContent={2} color="error">
                        <Notifications />
                        </Badge>
                        <Avatar sx={{width:30, height:30}} src="http://images.pexels.com/photos/846741/pexels-photo-846741.jpeg7auto=compress&cs=tinysrgb&w=1260&h=750&dr=2"/>
                        </Icons>
                        <UserBox>
                        <Avatar sx={{width:30, height:30}} src="http://images.pexels.com/photos/846741/pexels-photo-846741.jpeg7auto=compress&cs=tinysrgb&w=1260&h=750&dr=2"/>
                        <Typography variant="span">John</Typography>
                        </UserBox>
                </StyledToolbar>

                <Menu
                id="demo-position-menu"
                aria-labelledby="demo-position-button"
                anchorEl={anchorEl}
                open={open}
                onClose={handleClose}
                anchorOrigin={{
                    vertical: 'top',
                    horizontal:'left',
                }}
                transfromOrigin={{
                    vertical: 'top',
                    horizontal: 'left',
                }}
                >
                <MenuItem onClick={handleClose}>Proifile</MenuItem>
                <MenuItem onClick={handleClose}>My account</MenuItem>
                <MenuItem onClick={handleClose}>Logout</MenuItem>
                </Menu>
            </AppBar>
        );
};

export default Navbar;
